import './index.css'

const NavLink = props => {
  const {isActive, eachLink} = props

  return (
    <Link className="nav-link" to={eachLink.to} onClick={clickNavLink}>
      <li>{eachLink.name}</li>
    </Link>
  )
}

export default NavLink
